module.exports = {
    router: function(router) {
        /* GET home page. */
        router.get('/Home', function(req, res, next) {
            res.render('Home/index', {
                agentName: req.session.agentName,
                module: req.session.module
            });
        });
        router.get('/Home/welcome', function(req, res, next) {
            res.render('Home/welcome');
        });
        router.get('/DoQuote/INDEX', function(req, res, next) {
            res.render('DoQuote/INDEX');
        });
    }
};